[Form]
public class PurchJournalSelect_PackingSlip extends FormRun
{
    // <GEERU>
    #isoCountryRegionCodes
    // </GEERU>

    InventDimCtrl_Frm_Mov inventDimFormSetup;
    PurchJournalSelect_Invoice journalSelect;

    [FormObservable]
    ParmId parmId;

    FormObservableLink includedFormObservable = new FormObservableLink();

}

public void closeOk()
{
    super();

    journalSelect.closeOK();
}

/// <summary>
///     Returns the VendInvoiceInfoTable data source from caller form.
/// </summary>
/// <returns>
///     The data source that of VendInvoiceInfoTable.
/// </returns>
protected VendInvoiceInfoTable getVendInvoiceInfoTable_RU()
{
    VendIInvoiceInfoTable_RU callerFormRun = element.args().caller() as VendIInvoiceInfoTable_RU;

    return callerFormRun.getVendInvoiceInfoTable_RU();
}

public void init()
{
    PurchParmUpdate parmUpdate;

    super();

    if (element.args().dataset() == tableNum(PurchParmUpdate))
    {
        parmUpdate = element.args().record();
    }

    parmId = parmUpdate.ParmId;

    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        journalSelect = SalesPurchJournalSelect::newPurchJournalSelect(DocumentStatus::PackingSlip,
                                                                       element,
                                                                       parmUpdate.ParmId,
                                                                       element.getVendInvoiceInfoTable_RU().TableRefId,
                                                                       element.getVendInvoiceInfoTable_RU().PostingProfile ? element.getVendInvoiceInfoTable_RU().PostingProfile
                                                                                                                           : element.getVendInvoiceInfoTable_RU().purchTable().PostingProfile
                                                                      );
    }
    else
    {
        // </GEERU>
        journalSelect = SalesPurchJournalSelect::newPurchJournalSelect(DocumentStatus::PackingSlip,
                                                                       element,
                                                                       parmUpdate.ParmId);
        // <GEERU>
    }
    // </GEERU>

    element.updateDesign(InventDimFormDesignUpdate::Init);
    element.updateGroupLineDesign(false);
}

Object inventDimSetupObject()
