public void run()
{
    super();

    if (element.args().parm() == 'AllTab')
    {
        tabPageAll.setFocus();
    }
    else if (element.args().parm() == 'OverviewTab')
    {
        tabPageAll.visible(false);
    }
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    PurchLine purchLine;

    InventMovement movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

void updateGroupLineDesign(boolean _fromAllTabPage)
{
    tabLineOverview.visible(!_fromAllTabPage);
    tabLineGeneral.visible(!_fromAllTabPage);
    tabFinancialDimension.visible(!_fromAllTabPage);
    tabLineDimensions.visible(!_fromAllTabPage);

    tabLineOverviewAll.visible(_fromAllTabPage);
    tabLineGeneralAll.visible(_fromAllTabPage);
    tabFinancialDimensionAll.visible(_fromAllTabPage);
    tabLineDimensionsAll.visible(_fromAllTabPage);
}

boolean areLineTabPagesVisible()
{
    return tabLineOverview.visible() && tabLineGeneral.visible() && tabFinancialDimension.visible() && tabLineDimensions.visible();
}

