void clicked()
{
    Args args = new Args();

    if (element.areLineTabPagesVisible())
    {
        args.record(vendPackingSlipTrans);
    }
    else
    {
        args.record(vendPackingSlipTransAll);
    }

    new MenuFunction(menuitemDisplayStr(InventTransLot), MenuItemType::Display).run(args);
}
